import React from 'react';

function InfoCard(props) {
    return (
        <div>
            <a href={ props.link }>
                <img src={ props.img } />
                <div>
                    <h4>
                        { props.title }
                    </h4>
                    <p>
                        { props.note }
                    </p>
                </div>
            </a>
        </div>
    );
};
export default InfoCard;
